import React from "react";
import { Button, Navbar, NavbarBrand } from "react-bootstrap";

const AppNavbar = () => {
  return (
    <Navbar>
      <NavbarBrand>
        <h1 className="fs-3">Where in the world</h1>
      </NavbarBrand>
      <div className="dark-mode-option">
        <Button variant="white" className="capitallize">
          dark mode
        </Button>
      </div>
    </Navbar>
  );
};

export default AppNavbar;
